import React , {useState} from 'react'
import Select from 'react-select'

function FileName(){
  var countryList =[
    {
    value :1,
    label : 'Japan'
    },
    {
    value :2,
    label : 'China'
    },
    {
    value :3,
    label : 'Korea'
    },
    {
    value :4,
    label : 'Canada'
    }
    ];    
  const [result, value] = useState(countryList.label);
  const Handler = e => (value(e.label));
  if (result === "Canada") {
    const result = "https://hosters.pk/clientarea/index.php/login";
  } else {
    const result = "https://hosters.pk";
  }
  
return(
<div>
<Select options = {countryList} onChange={Handler}/>
    <h1>{result}</h1>
</div>
);
}

export default FileName;
